Eistee Lemon ist erfrischend und perfekt ausbalanciert zwischen süß und sauer. Er hat einen natürlichen Zitronengeschmack und ist einfach die beste Erfrischung an heißen Tagen. Absolut lecker und ein klarer Favorit!',NULL,'2025-03-25 14:04:02'),(78,40,53,5,'Die „Disney 100 Lustiges Taschenbuch Box“ ist ein wahres Sammlerstück! Die ersten zehn Bände bieten tolle klassische Disney-Geschichten, die die Herzen von Fans und neuen Lesern gleichermaßen erobern. Perfekt für eine nostalgische Zeitreise!',NULL,'2025-03-25 14:04:46'),(79,40,52,5,'Ein absolutes Meisterwerk! „Harry Potter und der Stein der Weisen“ hat mich sofort in die magische Welt von Hogwarts gezogen. Die Charaktere und die Geschichte sind einfach unvergesslich und der Beginn einer epischen Reise. Ein Muss für alle Fantasy-Fans!',NULL,'2025-03-25 14:05:04'),(80,41,60,1,'Der Geschmack gefaellt mir absolut nicht',NULL,'2025-03-25 14:05:21'),(81,41,62,1,'richtige Billigpizza',NULL,'2025-03-25 14:05:43'),(82,40,63,5,'Der John Deere Rasentraktor ist unglaublich leistungsstark und macht das Rasenmähen zu einem Kinderspiel. Der Komfort ist top, und mit dem vielseitigen Zubehör kann ich ihn für viele Gartenarbeiten nutzen. Eine tolle Investition für jeden, der große Rasenflächen pflegen muss!',NULL,'2025-03-25 14:05:52'),(83,41,57,1,'FCB ist besser',NULL,'2025-03-25 14:06:01'),(84,40,62,5,' Die Dr. Oetker Mozzarella Pizza ist einfach köstlich! Der Teig ist schön knusprig, der Mozzarella schmilzt perfekt und der Geschmack ist großartig. Eine schnelle und leckere Mahlzeit für jede Gelegenheit. Sehr empfehlenswert!',NULL,'2025-03-25 14:06:11'),(85,34,64,1,'Schlechtestes Auto auf Markt',_binary 'PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0\\0\0\0\0\0\0\\hb\0\0\0sRGB\0\\\0\0\0gAMA\0\0a\0\0\0	pHYs\0\0\\0\0\\od\0\0IDATx^w$]\?+Wu\\ɳavWڤU\l[\_>L4\`#\\ز$+Za%\J\g\'\tN\GU\ή$\z<\\ݕ\#|_\C%\#\( K\|\\Mg\Fy\\\\iU\С\\޽\u :z(^?}\G}dQ\E\\\kd\r۶\Z#\\#p\\Y\Z=\)f$n\\\02^ƶ-TU\=L\\<\\\\wll\\\\\S\/\pZI^\0O\n\\